import React, { Component } from "react";

class Get extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
      isLoaded: false
    };
  }

  componentDidMount() {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then((res) => res.json())
      .then((json) => {
        this.setState({
          isLoaded: true,
          items: json
        });
      });
  }

  render() {
    var { isLoaded, items } = this.state;

    if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      return (
        <div className="Post">
          <ul>
            {items.map((item) => (
              <li key={item.id}>Name: {item.name}</li>
            ))}
          </ul>
        </div>
      );
    }
  }
}

export default Get;
